import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import UploadProduct from "./uploadProduct"
import Home from "../home"

export default class dashboard extends Component {
    render() {
        return (
            <div>
                <Router>
                    <div>
                        <nav class="navbar navbar-expand-lg navbar-light bg-light">
                            <a class="navbar-brand" href="#">Navbar</a>
                            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                                <span class="navbar-toggler-icon"></span>
                            </button>
                            <div class="collapse navbar-collapse" id="navbarNav">
                                <ul class="navbar-nav">
                                    <li class="nav-item active">
                                        <Link class="nav-link" to="/uploadProduct">upload Product</Link>
                                    </li>
                                    <li class="nav-item">
                                        <Link class="nav-link" to="/users/">command product</Link>
                                    </li>
                                    <li class="nav-item">
                                        <Link class="nav-link" to="/Home">Home</Link>
                                    </li>

                                </ul>
                            </div>
                        </nav>

                        <Route path="/uploadProduct" component={UploadProduct} />
                        <Route path="/about/" component={UploadProduct} />
                        <Route path="/users/" component={UploadProduct} />
                        <Route path="/Home" component={Home} />

                    </div>
                </Router>

            </div>
        )
    }
}






